import React from 'react';
import './Register.css';
import RegisterDetails from '../Register/RegisterDetails';

const registerComponent = (props) => {
    let registerDetails : RegisterDetails = props.object;
  return (
    <div>
          <div id="signup">
                <input type="text" id="first" placeholder="First Name" value = {registerDetails.firstName}/>
                <input type="text" id="last" placeholder="Last Name" value = {registerDetails.firstName}/>
                <input type="email" id="email" placeholder="Email" value = {registerDetails.firstName}/>
            <input type="password" id="password" placeholder="Password" value = {registerDetails.firstName}/>
            <input type="text" id="address1" placeholder="Adress 1" value = {registerDetails.firstName}/>
              <input type="text" id="address2" placeholder="Adress 2" value = {registerDetails.firstName}/>
                <input type="text" id="city" placeholder="City" value = {registerDetails.firstName}/>
                  <input type="text" id="state" placeholder="State" value = {registerDetails.firstName}/>
                    <input type="text" id="country" placeholder="Country" value = {registerDetails.firstName}/>
                      <input type="text" id="zipcode" placeholder="zipcode" value = {registerDetails.firstName}/>
                        <input type="text" id="usertype" placeholder="usertype" value = {registerDetails.firstName}/>
            <button id="send">Send</button>
    </div>
        </div>
  );

}

export default registerComponent;
